description:
California

Travel Documentary hosted by Russ Harris, published by Smithsonian Channel broadcasted as part of Smithsonian Channel - Aerial America series in 2007 - English narration


Information
------------------------------

The Pacific Coast Highway of California offers drivers spectacular views while traveling along the edge of American culture. Buckle up for a non-stop flight over the mansion William Randolph Hearst built, the town Clint Eastwood governed and the farmland where Marilyn Monroe once held the title of Miss Artichoke. We soar over beaches and wine country, across Big Sur redwoods, under the Golden Gate Bridge and into the heart and soul of this magnificent state.

